import styled from "styled-components";
import Logo from "../../components/logo/logo";

export const BoldSpan = styled.span`
  font-weight: bold;
  font-size: 24px;
`;

export const LogoContainer = styled(Logo)`
  height: 25vmin;
  padding-bottom: 20px;
`;

export const HomePageContainer = styled.div`
  padding-top: 12vw;
`;
